import Container from '../../components/container'
import HeroPost from '../../components/hero-post'
import Layout from '../../components/layout'
// import { getAllPostsForHome } from '../../lib/api'
import Head from 'next/head'
// import { CMS_NAME } from '../../lib/constants'

export default function Index() {
  return (
    <>
      <Layout>
        <Container>
          <section className="cbu-offer">
            <h1>Click Bank University</h1>
            <h2>Start making money online today.</h2>
            <div className="video">
              <div className="buttons">
                <a href="">CLICK TO ENROLL NOW</a>
                <a href="">CLICK TO DOWN LOAD YOUR FREE BOOK - </a>
              </div>
            </div>

            <div className="course-info">

              <div className="grid flex flex-row grid-cols-12">
                <img className="col-span-6"/>
                <div className="col-span-6">
                  <h3>Meet Your Instructor!</h3>
                  <p>His name is, Justin Atlas. He has been listed as the top </p>
                  <a href="">Click To Enroll</a>
                </div>
              </div>

              <div className="grid flex flex-row grid-cols-12">
                <div>
                  <h3>Get Your Free Free Book</h3>
                  <p></p>
                  <a href="">CLICK TO DOWNLOAD</a>
                </div>
                <img />
              </div>

            </div>

          </section>
        </Container>
      </Layout>
    </>
  )
}

